CREATE TABLE `crm_rc_info` (
  `id` int(11) NOT NULL,
  `rc_id` int(11) NOT NULL,
  `customer_name` varchar(50) NOT NULL,
  `customer_email` varchar(200) NOT NULL,
  `rto_slip_no` varchar(20) NOT NULL,
  `rc_status` enum('1','2','3') NOT NULL DEFAULT '1' COMMENT '1-pending,2-inprocess,3-transferred',
  `rc_transfered` int(11) NOT NULL,
  `rc_transferred_date` datetime NOT NULL,
  `rto_agent` int(11) NOT NULL,
  `assigned_on` date NOT NULL,
