  `loan_case_type` enum('0','1','2','3') NOT NULL DEFAULT '0' COMMENT '0-none,1-refinance,2-topup,3-purchase',
  `bank_id_loan` int(11) NOT NULL,
  `loan_disbursement_date` datetime NOT NULL,
  `loan_delivery_date` datetime NOT NULL,
  `upload_rc_docs` enum('0','1') NOT NULL DEFAULT '0' COMMENT '0-not uploaded,1-uploaded',
  `rto_work` varchar(50) NOT NULL,
  `rto_charges` varchar(50) NOT NULL,
  `rto_actual_charges` varchar(50) NOT NULL,
  `payment_id` int(11) NOT NULL,
  `upload_doc_date` datetime NOT NULL,
  `rc_transferred_docs` enum('0','1') NOT NULL DEFAULT '0' COMMENT '1-not uploaded 2-uploaded',
  `rc_transferred_docs_date` datetime NOT NULL,
  `rc_detail_form_update` enum('0','1') NOT NULL DEFAULT '0',
  `updated_by` int(11) NOT NULL,
  `created_date` datetime NOT NULL,
  `updated_date` timestamp NOT NULL DEFAULT current_timestamp(),
  `status` enum('0','1') NOT NULL DEFAULT '1',
  `in_process_date` date NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

